import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoItems from "./components/todoItems";

function App() {
  return (
    <div className="App">
        <TodoItems title="Nghe nhạc" />
        <TodoItems title="Đi ngủ" />
        <TodoItems title="Học bài" />
    </div>
  );
}

export default App;
